  },
];

const columns = [
  {
    title: "Date / Time",
    dataIndex: "datetime",
    key: "datetime",
  },
  {
    title: "Targeted IP Address",
    dataIndex: "ip",
    key: "ip",
  },
  {
    title: "MAC Address",
    dataIndex: "mac",
    key: "mac",
  },
  {
    title: "Threat Type",
    dataIndex: "threat",
    key: "threat",
    filters: [
      {
        text: "Trojan",
        value: "Trojan",
      },
      {
        text: "Rootkit",
        value: "Rootkit",
      },
    ],
    onFilter: (value, record) => record.threat.includes(value),
    filterMode: "tree",
    filterSearch: true,
  },
];

export default ThreatsTable;
